- request:
    body: '{"messages": [{"role": "user", "content": "Assess the quality of the task
      completed based on the description, expected output, and actual results.\n\nTask
      Description:\nResearch a topic to teach a kid aged 6 about math.\n\nExpected
      Output:\nA topic, explanation, angle, and examples.\n\nActual Output:\nAfter
      careful research and consideration, I have found that the best way to introduce
      math to a 6-year-old is through a topic that they are already familiar with
      and enjoy. In this case, I would suggest using the topic of \"Animals at the
      Zoo.\" This topic is playful, engaging, and allows for the introduction of basic
      math concepts like counting, addition, and subtraction.\n\nAngle: \nThe angle
      of approach would be to blend a storytelling narrative with math problems. Expressing
      math through a story makes it more relatable and less intimidating for a child.
      \n\nExplanation: \nThe story would be about a zookeeper who needs help counting
      the animals and keeping track of them in the zoo. Each animal in the zoo represents
      a number, and the child''s task is to help the zookeeper count the total number
